import React from 'react'

export const table = ({ classes, headers, bodies }) => {
    
    const createColumns = () => {
        return `<tr>
            ${headers.map(head => `<th ${head.params.map} >${head.value}</th>`)}
        </tr>`
    }

    return (
        <table className={classes}>
            <thead>{createColumns()}</thead>
            <tbody>{bodies}</tbody>
        </table>
    )
}
